        SubTitle = "2025 Edition",
        TabWidth = 160,
        Size = UDim2.fromOffset(580, 340),
        Acrylic = true,
        Theme = "Dark",
        MinimizeKey = Enum.KeyCode.H,
    })

    local Tabs = {
        Free = Window:AddTab({ Title = "Free", Icon = "🎮" }),
        Other = Window:AddTab({ Title = "Other", Icon = "🔐" }),
    }

    local externalValid = validateExternalScript()

    local LoadScript = Tabs.Free:AddButton({
        Title = "Load Script",
        Description = "Load the script if available",
        Callback = function()
            if externalValid then
                Window:Destroy()
                loadScripts(false)
            else
                showNotification("Error!", "Script is down. Join Discord for updates.", "rbxassetid://123461")
            end
        end
    })

    local InputKey = Tabs.Other:AddInput("InputKey", {
        Title = "Input Key",
        Description = "Insert your key...",
        Default = "",
        Placeholder = "Enter key...",
        Numeric = false,
        Finished = false,
    })

    local CheckKey = Tabs.Other:AddButton({
        Title = "Check Key",
        Description = "Enter Key before pressing this button",
        Callback = function()
            local response = KeyGuardLibrary.validateDefaultKey(InputKey.Value)
            if response == trueData then
                writefile(Directory, InputKey.Value)
                showNotification("Success!", "Key Saved Successfully!", "rbxassetid://123456")
                wait(1)
                Window:Destroy()
                loadScripts(false)
            else
                showNotification("Error!", "Invalid Key. Try again.", "rbxassetid://123457")
            end
        end
    })

    local ValidatePremiumKey = Tabs.Other:AddButton({
        Title = "Validate Premium Key",
        Description = "Enter Premium Key before pressing this button",
        Callback = function()
            local response = KeyGuardLibrary.validatePremiumKey(InputKey.Value)
            if response == trueData then
                writefile(PremiumKeyDirectory, InputKey.Value)
                showNotification("Success!", "Premium Key Validated!", "rbxassetid://123459")
                wait(1)
                Window:Destroy()
                loadScripts(true)
            else
                showNotification("Error!", "Invalid Premium Key. Try again.", "rbxassetid://123460")
            end
        end
    })

    local GetKey = Tabs.Other:AddButton({
        Title = "Get Key",
        Description = "Copy Key Link",
        Callback = function()
            setclipboard(KeyGuardLibrary.getLink())
            showNotification("Copied!", "Link Copied. Paste it in your browser", "rbxassetid://123458")
        end
    })

    Tabs.Other:AddButton({
        Title = "Note",
        Description = "This is optional. The premium feature has fewer features. It was an extra feature for premium users, now offered only to those who already bought it.",
        Callback = function() end,
        Disabled = true
    })

    Window:SelectTab(1)
end

